import Vue from 'vue';
import axios from 'axios';
import Swal from 'sweetalert2';
const base_url = 'http://localhost:3000';

export default Vue.extend({
    data() {
        return {
            task: [],
            page: 'main'
        }
    },
    created() {
        this.getAllTask();
    },
    computed: {
        backlogData() {
            let data = this.task.filter(x => {
                return x.category === 'Back-Log'
            });
            return data;
        },
        todoData() {
            let data = this.task.filter(x => {
                return x.category === 'To-Do'
            });
            return data;
        },
        doneData() {
            let data = this.task.filter(x => {
                return x.category === 'Done'
            });
            return data;
        },
        completedData() {
            let data = this.task.filter(x => {
                return x.category === 'Completed'
            });
            return data;
        }
    },
    methods: {
        getAllTask() {
            axios({
                method: 'GET',
                url: base_url + '/tasks',
                headers: {
                    token: localStorage.getItem('token')
                }
            })
            .then(({ data }) => {
                this.task = [];
                data.forEach(x => {
                    this.task.push(x);
                })
            }).catch(err => {
                this.$emit('showError', err);
            });
        },
        mainPage() {
            this.getAllTask();
            this.page = 'main';
        },
        logOutUser() {
            this.$emit('logOutUser', 'login');
        },
        deleteData(id) {
            Swal.fire({
                title: 'Are you sure?',
                text: "You won't be able to revert this!",
                icon: 'warning',
                showCancelButton: true,
                confirmButtonColor: '#3085d6',
                cancelButtonColor: '#d33',
                confirmButtonText: 'Yes, delete it!'
              }).then((result) => {
                if (result.value) {
                    axios({
                        method: 'DELETE',
                        url: base_url + `/tasks/${id}`,
                        headers: {
                            token: localStorage.getItem('token')
                        }
                    })
                    .then(() => {
                        Swal.fire(
                            'Deleted!',
                            'Your file has been deleted.',
                            'success'
                        )
                        this.mainPage();
                    }).catch(err => {
                        this.$emit('showError', err);
                    });
                }
              })
        },
        addTaskForm() {
            this.$emit('changePage', 'createTask');
        },
        editDataForm(id) {
            this.$emit('editDataForm', id);
        }
    }
})
